    let data =[
        {
            name: "Devon",
            tasks: [
                {
                    taskName: "mow the grass",
                    isComplete: false,
                    order: 1
                },
                {
                    taskName: "eat some tea",
                    isComplete: true,
                    order: 3
                },
                {
                    taskName: "cry",
                    isComplete: false,
                    order: 2
                }
            ]
        },
        {
            name: "Johnny",
            tasks: [
                {
                    taskName: "mow the grass",
                    isComplete: false
                },
                {
                    taskName: "hhhhhhhhhh",
                    isComplete: true
                },
                {
                    taskName: "cry",
                    isComplete: false
                }
            ]
        }
    ]

    const [usersTasks, setUsersTasks] = useState([]);
    const [myTasks, setMyTasks] = useState([]);
    const [signedInUser, setSignedInUser] = useState("Devon");

    useEffect(() => {
        setMyTasks(data);
    }, [])


    return (
        <div className="App">
            {
                data.map(user => {
                    return (
                        <div>
                            <p>
                                {user.name}
                            </p>
                            {
                            console.log(Array.isArray(user.tasks))
                }{          
                            Array.isArray(user.tasks) ?
                            user.tasks.map( (task) => {
                                console.log(task)
                                    return (
                                        <p>
                                            {task.taskName}
                                        </p>
                                    );
                            }) : null

                            (user.name === signedInUser) ?
                                <span>
                                    <TextField id="filled-basic" label="Filled" variant="filled" />
                                        <Button>
                                            Send
                                        </Button>
                                </span>
                            : null
                            }
                        </div>
                    )

                })
            }

        </div>
    );
}

export default App;
